import React, { Component } from 'react';

export class GrandPrixCounter extends Component {
  render() {
    return (
      <div>
        <h4>689,562</h4>
        <h5>Grand Prixs this week</h5>
      </div>
    )
  }
}

export default GrandPrixCounter;
